import React, { useState, useEffect } from 'react';
import { Filter, Search, ChevronRight, Video, Edit3, Clock, CheckCircle, Bell, Calendar, User, MoreHorizontal, LayoutList, CheckSquare, ArrowRight } from 'lucide-react';
import { InterviewSession, Status } from '../types';

interface EmployeeTaskTableProps {
    type: 'plans' | 'reviews' | 'interviews';
    onAction: (task: any, actionType?: 'schedule' | 'feedback') => void;
    sessions?: InterviewSession[];
    isMobile?: boolean; // New prop for mobile view
}

const EmployeeTaskTable: React.FC<EmployeeTaskTableProps> = ({ type, onAction, sessions, isMobile = false }) => {
    const [openActionId, setOpenActionId] = useState<string | null>(null);
    const [activeTab, setActiveTab] = useState<string>(type === 'interviews' ? 'schedule' : 'todo');

    useEffect(() => {
        const handleClickOutside = () => setOpenActionId(null);
        if (openActionId) {
            window.addEventListener('click', handleClickOutside);
        }
        return () => window.removeEventListener('click', handleClickOutside);
    }, [openActionId]);

    const getCount = (tab: string) => {
        if (type !== 'interviews' || !sessions) return 0;
        return sessions.filter(session => {
             if (tab === 'schedule') return session.status === Status.NotStarted && (session.schedulingStatus === 'pending' || !session.schedulingStatus);
             if (tab === 'start') return session.status === Status.NotStarted && session.schedulingStatus === 'scheduled';
             if (tab === 'feedback') return session.status === Status.InProgress;
             if (tab === 'confirm') return session.status === Status.PendingConfirmation;
             if (tab === 'done') return session.status === Status.Completed;
             return false;
        }).length;
    };

    const getFilteredTasks = () => {
        if (type === 'interviews' && sessions) {
             return sessions.filter(session => {
                if (activeTab === 'schedule') return session.status === Status.NotStarted && (session.schedulingStatus === 'pending' || !session.schedulingStatus);
                if (activeTab === 'start') return session.status === Status.NotStarted && session.schedulingStatus === 'scheduled';
                if (activeTab === 'feedback') return session.status === Status.InProgress;
                if (activeTab === 'confirm') return session.status === Status.PendingConfirmation;
                if (activeTab === 'done') return session.status === Status.Completed;
                return false;
             }).map(s => ({
                 id: s.id,
                 name: s.period,
                 employee: s.employeeName,
                 period: s.assessmentCycle || s.period,
                 manager: s.managerName,
                 step: activeTab === 'confirm' ? '待确认' : '面谈沟通',
                 deadline: s.deadline || (s.date ? s.date.split(' ')[0] : '-'),
                 status: s.status,
                 rawSession: s,
                 avatar: 'https://picsum.photos/id/64/100/100' // Mock avatar
             }));
        }

        if (type === 'plans') {
             const allPlans = [
                { id: 'p1', name: '任务到期8月', employee: '李莎', period: '2024年8月', step: '任务到期开始', deadline: '2024-09-05', status: 'pending', manager: undefined, rawSession: undefined },
                { id: 'p2', name: '移动端评语必填全年', employee: '李莎', period: '2024年全年', step: '制定', deadline: '-', status: 'pending', manager: undefined, rawSession: undefined },
             ];
             if (activeTab === 'todo') return allPlans.filter(p => p.status === 'pending');
             return allPlans; 
        }
        return [];
    };

    const tasks = getFilteredTasks();
    const title = type === 'interviews' ? '绩效面谈' : type === 'plans' ? '计划制定' : '待办任务';

    const handleActionClick = (e: React.MouseEvent, task: any) => {
        e.stopPropagation();
        if (type === 'interviews') {
            setOpenActionId(openActionId === task.id ? null : task.id);
        } else {
            onAction(task);
        }
    };

    // Tabs Render
    const renderTabs = () => {
        const tabs = type === 'interviews' ? [
             { id: 'schedule', label: '待排期' },
             { id: 'start', label: '待开始' },
             { id: 'feedback', label: '待反馈' },
             { id: 'confirm', label: '待确认' },
             { id: 'done', label: '已完成' },
        ] : [
             { id: 'todo', label: '待处理' },
             { id: 'done', label: '已完成' },
        ];

        if (isMobile) {
            return (
                <div className="flex space-x-4 overflow-x-auto hide-scrollbar px-4 py-2 bg-white border-b border-gray-100">
                    {tabs.map(tab => {
                        const isActive = activeTab === tab.id;
                        const count = getCount(tab.id);
                        return (
                            <button 
                                key={tab.id}
                                onClick={() => setActiveTab(tab.id)}
                                className={`flex flex-col items-center min-w-[60px] py-1 transition-colors relative ${isActive ? 'text-blue-600' : 'text-gray-500'}`}
                            >
                                <span className={`text-lg font-bold ${isActive ? 'text-gray-900' : 'text-gray-400'}`}>{count}</span>
                                <span className="text-xs">{tab.label}</span>
                                {isActive && <div className="absolute bottom-0 w-4 h-1 bg-blue-600 rounded-full"></div>}
                            </button>
                        );
                    })}
                </div>
            );
        }

        return (
             <div className="flex space-x-1 border-b border-gray-300">
                 {tabs.map(tab => {
                     const isActive = activeTab === tab.id;
                     return (
                         <button 
                            key={tab.id}
                            onClick={() => setActiveTab(tab.id)}
                            className={`px-6 py-2.5 text-sm font-medium transition-colors relative border-b-2 ${
                                isActive 
                                ? 'border-primary text-primary font-bold' 
                                : 'border-transparent text-gray-500 hover:text-gray-800'
                            }`}
                         >
                             {tab.label}
                             {type === 'interviews' && <span className={`ml-2 text-xs py-0.5 px-1.5 rounded-full ${isActive ? 'bg-primary-100 text-primary-700' : 'bg-gray-100 text-gray-500'}`}>
                                 {getCount(tab.id)}
                             </span>}
                         </button>
                     );
                 })}
             </div>
        );
    };

    // Action Buttons Render
    const renderAction = (task: any) => {
        if (type === 'interviews') {
            if (activeTab === 'schedule') {
                 if (isMobile) {
                     return (
                         <button onClick={() => onAction(task.rawSession, 'schedule')} className="w-full py-2 bg-blue-50 text-blue-600 text-sm font-medium rounded-lg mt-3 flex items-center justify-center">
                             预约面谈
                         </button>
                     );
                 }
                 return (
                    <div className="flex justify-end space-x-2">
                        <button 
                            onClick={() => onAction(task.rawSession, 'schedule')} 
                            className="text-primary hover:text-primary-700 text-xs font-medium border border-primary-200 bg-primary-50 px-3 py-1.5 rounded flex items-center transition-colors shadow-sm whitespace-nowrap"
                        >
                            <Calendar size={12} className="mr-1.5" /> 预约面谈
                        </button>
                        <button 
                            onClick={() => onAction(task.rawSession, 'feedback')} 
                            className="text-gray-600 hover:text-primary-600 text-xs font-medium border border-gray-200 bg-white px-3 py-1.5 rounded flex items-center transition-colors shadow-sm hover:bg-gray-50 whitespace-nowrap"
                        >
                            <Edit3 size={12} className="mr-1.5" /> 直接反馈
                        </button>
                    </div>
                 )
            }
            // ... (Other states logic mostly reused or simplified for mobile below)
            if (isMobile) {
                let label = '查看详情';
                if (activeTab === 'start') label = '去面谈';
                if (activeTab === 'feedback') label = '填写反馈';
                if (activeTab === 'confirm') label = '去确认';

                return (
                    <button onClick={() => onAction(task.rawSession)} className={`w-full py-2 text-sm font-medium rounded-lg mt-3 flex items-center justify-center ${activeTab === 'confirm' ? 'bg-green-50 text-green-700' : 'bg-blue-50 text-blue-600'}`}>
                        {label}
                    </button>
                );
            }

            if (activeTab === 'start') {
                return <button onClick={() => onAction(task.rawSession)} className="text-primary hover:text-primary-700 text-xs font-medium border border-primary-200 bg-primary-50 px-3 py-1.5 rounded flex items-center justify-end ml-auto">去面谈</button>
            }
            if (activeTab === 'feedback') {
                 return <button onClick={() => onAction(task.rawSession)} className="text-ai-600 hover:text-ai-700 text-xs font-medium border border-ai-200 bg-ai-50 px-3 py-1.5 rounded flex items-center justify-end ml-auto"><Edit3 size={12} className="mr-1"/> 填写反馈</button>
            }
            if (activeTab === 'confirm') {
                 return <button onClick={() => onAction(task.rawSession)} className="text-green-600 hover:text-green-700 text-xs font-medium border border-green-200 bg-green-50 px-3 py-1.5 rounded flex items-center justify-end ml-auto"><CheckCircle size={12} className="mr-1"/> 去确认</button>
            }
             return <button onClick={() => onAction(task.rawSession)} className="text-gray-500 hover:text-gray-800 text-xs font-medium hover:underline flex items-center justify-end ml-auto">查看详情</button>
        }

        // Plans / Reviews
        if (isMobile) {
             return (
                <button onClick={() => onAction(task)} className="w-full py-2 bg-white border border-gray-200 text-gray-700 text-sm font-medium rounded-lg mt-3 flex items-center justify-center">
                    去处理
                </button>
             );
        }
        return (
             <button onClick={() => onAction(task)} className="text-primary hover:text-primary-700 text-xs font-medium flex items-center justify-end w-full hover:underline">
                去制定 <ChevronRight size={12} />
            </button>
        )
    };

    // Mobile View Render
    if (isMobile) {
        return (
            <div className="flex flex-col h-full bg-[#F5F7FA]">
                {/* Mobile Header (Tabs are sticky or fixed in parent, handled here) */}
                {renderTabs()}

                <div className="flex-1 overflow-y-auto p-4 space-y-3 pb-20">
                    {tasks.length > 0 ? (
                        tasks.map(task => (
                            <div key={task.id} className="bg-white rounded-xl p-4 shadow-sm border border-gray-100 relative overflow-hidden" onClick={() => onAction(task.rawSession)}>
                                {/* Status Color Bar */}
                                <div className={`absolute left-0 top-0 bottom-0 w-1 ${activeTab === 'confirm' ? 'bg-green-500' : activeTab === 'schedule' ? 'bg-orange-400' : 'bg-blue-500'}`}></div>

                                <div className="flex justify-between items-start mb-3 pl-2">
                                    <div className="flex items-center">
                                        <div className="w-8 h-8 rounded-full bg-gray-100 flex items-center justify-center text-xs font-bold text-gray-600 mr-2">
                                            {task.employee ? task.employee.charAt(0) : 'E'}
                                        </div>
                                        <div>
                                            <div className="font-bold text-gray-900 text-sm">{task.employee}</div>
                                            <div className="text-xs text-gray-500">{task.period}</div>
                                        </div>
                                    </div>
                                    <div className="text-xs bg-gray-100 text-gray-600 px-2 py-0.5 rounded">
                                        {task.step}
                                    </div>
                                </div>

                                <div className="pl-2 mb-3">
                                    <h4 className="font-bold text-gray-800 text-sm mb-1">{task.name}</h4>
