                                    <td className="px-4 py-4">
                                        <div className="flex items-center text-gray-600">
                                            {(activeTab !== 'schedule' && activeTab !== 'todo' && task.deadline !== '-') && <Clock size={12} className="mr-1.5 text-gray-400" />}
                                            {task.deadline}
