    const [selectedSession, setSelectedSession] = useState<InterviewSession | null>(null);

    const handleTaskAction = (task: any, actionType?: 'schedule' | 'feedback') => {
        // task can be InterviewSession or a simple object from EmployeeTaskTable
        // We need to find the full session object if it's not passed
        const session = sessions.find(s => s.id === task.id) || task;
        setSelectedSession(session);
        setView('detail');
    };

    const handleBackToList = () => {
        setSelectedSession(null);
        setView('list');
    };

    const handleConfirm = () => {
        alert('提交成功！');
