import React, { useState } from 'react';
import { InterviewSession, Status } from '../types';
import EmployeeTaskTable from './EmployeeTaskTable';
import InterviewConfirmationView from './InterviewConfirmationView';
import InterviewForm from './InterviewForm';
import MobileDashboard from './MobileDashboard';
import ScheduleMeetingModal from './ScheduleMeetingModal';
import { ArrowLeft } from 'lucide-react';

interface MobileAppProps {
    sessions: InterviewSession[];
    onExit: () => void;
}

type ViewState = 'dashboard' | 'list' | 'detail' | 'form';

const MobileApp: React.FC<MobileAppProps> = ({ sessions, onExit }) => {
    const [view, setView] = useState<ViewState>('dashboard');
    const [listType, setListType] = useState<string>('interviews'); // plans, reviews, interviews
    const [selectedSession, setSelectedSession] = useState<InterviewSession | null>(null);

    // Schedule Modal State
    const [isScheduleModalOpen, setIsScheduleModalOpen] = useState(false);

    // 1. Navigation Handlers
    const handleNavigateToList = (type: string) => {
        setListType(type);
        setView('list');
    };

    const handleTaskAction = (task: any, actionType?: 'schedule' | 'feedback') => {
        // task can be InterviewSession or a simple object from EmployeeTaskTable
        const session = sessions.find(s => s.id === task.id) || task;

        if (actionType === 'schedule') {
            setSelectedSession(session);
            setIsScheduleModalOpen(true);
        } else if (actionType === 'feedback') {
            // For feedback, we open the form in 'direct' mode logic (editing)
            // Mocking the transition to InProgress/Direct
            const updatedSession = { ...session, method: 'direct', status: 'InProgress' };
            setSelectedSession(updatedSession);
            setView('form');
        } else {
            // Default click - usually view details or confirmation depending on status
            setSelectedSession(session);
            if (session.status === Status.PendingConfirmation) {
                setView('detail');
            } else {
                setView('form'); // View form for other states too
            }
        }
    };

    const handleBack = () => {
        if (view === 'detail' || view === 'form') {
            setSelectedSession(null);
            setView('list');
        } else if (view === 'list') {
            setView('dashboard');
        } else {
            onExit();
        }
    };

    const handleConfirmAction = () => {
        alert('操作成功！');
        setSelectedSession(null);
        setView('list');
    };

    const handleScheduleConfirm = (data: any) => {
        setIsScheduleModalOpen(false);
