interface MobileAppProps {
    sessions: InterviewSession[];
    onExit: () => void;
}

type ViewState = 'dashboard' | 'list' | 'detail' | 'form';
type TabState = 'work' | 'team' | 'my';

const MobileApp: React.FC<MobileAppProps> = ({ sessions, onExit }) => {
    const [view, setView] = useState<ViewState>('dashboard');
    const [activeTab, setActiveTab] = useState<TabState>('work');

    const [listType, setListType] = useState<string>('interviews'); // plans, reviews, interviews
    const [selectedSession, setSelectedSession] = useState<InterviewSession | null>(null);

    // Schedule Modal State
    const [isScheduleModalOpen, setIsScheduleModalOpen] = useState(false);

    // 1. Navigation Handlers
    const handleNavigateToList = (type: string) => {
        setListType(type);
        setView('list');
    };

    const handleTaskAction = (task: any, actionType?: 'schedule' | 'feedback') => {
        // task can be InterviewSession or a simple object from EmployeeTaskTable
        const session = sessions.find(s => s.id === task.id) || task;

        if (actionType === 'schedule') {
            setSelectedSession(session);
            setIsScheduleModalOpen(true);
        } else if (actionType === 'feedback') {
            // For feedback, we open the form in 'direct' mode logic (editing)
            // Mocking the transition to InProgress/Direct
            const updatedSession = { ...session, method: 'direct', status: 'InProgress' };
            setSelectedSession(updatedSession);
            setView('form');
        } else {
            // Default click - usually view details or confirmation depending on status
            setSelectedSession(session);
            if (session.status === Status.PendingConfirmation) {
                setView('detail');
            } else {
                setView('form'); // View form for other states too
            }
        }
    };

    const handleBack = () => {
        if (view === 'detail' || view === 'form') {
            setSelectedSession(null);
            setView('list');
        } else if (view === 'list') {
            setView('dashboard');
        } else {
            onExit();
        }
    };

    const handleConfirmAction = () => {
        alert('操作成功！');
        setSelectedSession(null);
        setView('list');
    };

    const handleScheduleConfirm = (data: any) => {
        setIsScheduleModalOpen(false);
        alert(`预约成功！\n时间: ${data.date} ${data.time}\n方式: ${data.method}`);
        // In a real app, update session status here
    };

    // 2. Render Views (Drill Down Pages)

    // View: Form / Feedback (Manager or Employee viewing form)
    if (view === 'form' && selectedSession) {
        return (
            <InterviewForm 
                session={selectedSession} 
                onBack={handleBack} 
                onStart={() => {}} 
                onSubmitFeedback={handleConfirmAction}
            />
        );
    }

    // View: Confirmation (Employee signing off)
    if (view === 'detail' && selectedSession) {
        return (
            <InterviewConfirmationView 
                session={selectedSession} 
                onBack={handleBack} 
                onConfirm={handleConfirmAction} 
            />
        );
    }

    // View: List (Drill down from Dashboard Work Tab)
    if (view === 'list') {
        return (
            <>
                <div className="h-full flex flex-col bg-[#F5F7FA]">
                    <div className="bg-white px-4 py-3 border-b border-gray-200 flex items-center sticky top-0 z-10">
                        <button onClick={handleBack} className="text-gray-500 hover:text-gray-900 p-1 -ml-1">
                            <ArrowLeft size={20} />
                        </button>
                        <div className="flex-1 text-center font-bold text-gray-800 text-lg pr-6">
                            {listType === 'interviews' ? '绩效面谈' : '任务列表'}
                        </div>
                    </div>
                    <div className="flex-1 overflow-hidden">
                        <EmployeeTaskTable 
                            type={listType as any} 
                            onAction={handleTaskAction} 
                            sessions={sessions} 
                            isMobile={true} 
                        />
                    </div>
                </div>

                {/* Schedule Modal rendered here to be on top of list */}
                <ScheduleMeetingModal 
                    isOpen={isScheduleModalOpen} 
                    onClose={() => setIsScheduleModalOpen(false)} 
                    onConfirm={handleScheduleConfirm} 
                    session={selectedSession} 
                />
            </>
        );
    }

    // View: Dashboard (Top Level Tabs)
    const pendingInterviews = sessions.filter(s => s.status !== Status.Completed).length;

    return (
        <div className="h-full flex flex-col relative bg-[#F5F7FA]">
            {/* Top Bar for Dashboard (Only for Work tab usually, or customized per tab) */}
            {activeTab === 'work' && (
                <div className="absolute top-3 left-3 z-20">
                     <button onClick={onExit} className="bg-black/10 hover:bg-black/20 text-gray-600 p-2 rounded-full backdrop-blur-sm transition-colors">
                        <ArrowLeft size={18} />
                    </button>
                </div>
            )}

            <div className="flex-1 overflow-hidden">
                {activeTab === 'work' && (
                    <MobileDashboard 
                        onNavigate={handleNavigateToList}
                        interviewCount={pendingInterviews}
                    />
                )}
                {activeTab === 'team' && <MobileTeamList />}
                {activeTab === 'my' && <MobileHistoryList />}
            </div>

            {/* Bottom Navigation Bar */}
            <div className="bg-white border-t border-gray-200 flex justify-around items-center h-16 shrink-0 pb-safe z-30 shadow-[0_-4px_6px_-1px_rgba(0,0,0,0.02)]">
                <button 
                    onClick={() => setActiveTab('work')}
                    className={`flex flex-col items-center justify-center w-full h-full space-y-1 ${activeTab === 'work' ? 'text-blue-600' : 'text-gray-400'}`}
                >
                    <LayoutDashboard size={20} className={activeTab === 'work' ? 'fill-blue-100' : ''} />
                    <span className="text-[10px] font-medium">工作台</span>
                </button>
                <button 
                    onClick={() => setActiveTab('team')}
                    className={`flex flex-col items-center justify-center w-full h-full space-y-1 ${activeTab === 'team' ? 'text-blue-600' : 'text-gray-400'}`}
                >
                    <Users size={20} className={activeTab === 'team' ? 'fill-blue-100' : ''} />
                    <span className="text-[10px] font-medium">团队</span>
                </button>
                <button 
                    onClick={() => setActiveTab('my')}
                    className={`flex flex-col items-center justify-center w-full h-full space-y-1 ${activeTab === 'my' ? 'text-blue-600' : 'text-gray-400'}`}
                >
                    <User size={20} className={activeTab === 'my' ? 'fill-blue-100' : ''} />
                    <span className="text-[10px] font-medium">我的</span>
                </button>
            </div>
        </div>
    );
};

